import OscarData from './data.csv';
import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState(null);
  const [clickedLabelIndex, setClickedLabelIndex] = useState(null); // New state variable to store clicked label index

  useEffect(() => {
    Papa.parse(OscarData, {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: ((result) => {
        console.log(result);
        const labelCounts = {}; // Object to store label counts

        result.data.forEach((item) => {
          const label = item['req1Product'];

          if (label) {
            if (labelCounts[label]) {
              labelCounts[label] += 1;
            } else {
              labelCounts[label] = 1;
            }
          }
        });

        setChartData({
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "black",
              backgroundColor: "red"
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of req1Product Values"
            }
          },
          scales: {
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count"
              }
            }
          }
        });
      })
    });
  }, []);

  const handleColumnClick = (event, activeElements) => {
    if (activeElements.length > 0) {
      const labelIndex = activeElements[0].index;
      setClickedLabelIndex(labelIndex); // Update clicked label index

      const clickedLabel = chartData.labels[labelIndex];

      // Create a new chart for the label count from the 'prediction' column
      const predictionLabelCounts = {};
      Papa.parse(OscarData, {
        download: true,
        header: true,
        dynamicTyping: true,
        delimiter: "",
        complete: ((result) => {
          result.data.forEach((item) => {
            const prediction = item['prediction'];
            const label = item['req1Product'];

            if (label === clickedLabel && prediction !== undefined) {
              if (predictionLabelCounts[prediction]) {
                predictionLabelCounts[prediction] += 1;
              } else {
                predictionLabelCounts[prediction] = 1;
              }
            }
          });

          const labelCountChartData = {
            labels: Object.keys(predictionLabelCounts),
            datasets: [
              {
                label: "Count",
                data: Object.values(predictionLabelCounts),
                borderColor: "black",
                backgroundColor: ["red", "blue"] // Customize colors for 0 and 1
              }
            ]
          };

          const labelCountChartOptions = {
            responsive: true,
            plugins: {
              legend: {
                position: 'top'
              },
              title: {
                display: true,
                text: `Label Count for ${clickedLabel}`
              }
            },
            scales: {
              y: {
                beginAtZero: true,
                title: {
                  display: true,
                  text: "Count"
                }
              }
            }
          };

          setLabelCountData({
            chartData: labelCountChartData,
            chartOptions: labelCountChartOptions
          });
        })
      });
    }
  };

  return (
    <div>
      <h1>HOME PAGE</h1>
      {chartData.datasets.length > 0 ? (
        <div>
          <Bar options={{...chartOptions, onClick: handleColumnClick}} data={chartData} />
          {labelCountData && (
            <div>
              <h2>Label Count for {chartData.labels[clickedLabelIndex]}</h2>
              <Bar options={labelCountData.chartOptions} data={labelCountData.chartData} />
            </div>
          )}
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
}

export default Home;
